import React from 'react';
import "bootstrap/dist/css/bootstrap.min.css";



function Form({dash}){

  if(((localStorage.getItem("user"))[0]["restaurantName"])===(dash.name_dash)){
    return(
      <div className="container-fluid">
      <div className="card mb-12" style={{maxWidth: "1040px", objectFit:"contain"}}>
        <div className="row g-0">
          <div className="col-md-12">
            <img src={`${dash.picturesRes_dash}`} className="img-fluid rounded-start" alt="dash-img" />
          </div>
        <div className="col-md-12">
         <div className="card-body">
          <h5 className="card-title">{`${dash.name_dash}`}</h5>
           <h5 className="card-text">{`${dash.location_dash}`}</h5>
           <p className="card-text">{`${dash.decription_dash}`}</p>
           <p className="card-text">{`${dash.contact_dash}`}</p>
           <p className="card-text"><small className="text-muted">{`${dash.timings_dash}`}</small></p>
           </div>
        </div>
      </div>
      </div>
      </div>
    )


  }


}


export default Form;
